	def __init__(self, WT_seq, seq_listfilename, fitness_filename, training_percent=0.5, limit_rounds=True, max_rounds=100, alpha=0.1, l1=0.0, l2=0.0, epsilon=0.0000001): #Accept structures here?
	
		self.WT_seq = WT_seq
		
		self.seq_list = []  #This file determines the order of all the sequences in the features
		infile = open(seq_listfilename, 'r')
		for line in infile:
			self.seq_list.append(line.strip())
		infile.close()
		
		self.training_size = 0.0
		self.testing_size = 0.0
		self.training_percent = training_percent
		
	
		self.identity_features = []
		self.value_features = []
		self.structural_features = []
		self.quality_features = []
		
		self.compound_features = []
		
