		self.alpha_reset_factor = 2.0 #Factor by which to divide the learning rate if it is too large
	
		self.epsilon = epsilon #Criteria for calling learning converged

		self.l1 = l1 #Regularization lambda one, for the linear(abs) term in elastic net regularization
		self.l2 = l2 #Regularization lambda two, for quadratic term (this is the Coursera regularization term)

	
		self.limit_rounds = limit_rounds
		self.max_rounds = max_rounds #Mostly for training?

		self.training_costs = [] #keep track of cost for training set as a function of the steps
		self.testing_costs = [] #keep track of cost for test set as a function of the steps
		
		self.readFitnessFile(fitness_filename)
		self.selectTrainingAndTestSets()
		
