	def getCurrentPrediction(self):
	
		prediction = multiplied_feature = self.generateEmptyFeature(len(self.seq_list), value=0.0)
		for feature in self.compound_features:
			prediction += (feature[0]['weight'])*(feature[0]['feature'])
			
		return prediction


	def readFitnessFile(self, filename):

		fitnessfile = open(filename, 'r')
		
		self.fitness_feature = self.generateEmptyFeature(len(self.seq_list))
		self.stddev_feature = self.generateEmptyFeature(len(self.seq_list))
		self.sem_feature = self.generateEmptyFeature(len(self.seq_list))
		self.RMSE_feature = self.generateEmptyFeature(len(self.seq_list))
		self.mean_frequency_feature = self.generateEmptyFeature(len(self.seq_list))
		self.num_replicates_feature = self.generateEmptyFeature(len(self.seq_list))
		
		for line in fitnessfile:
			if line[0] == '#':
				continue
			fields =line.split(',')
			seq = fields[-1].strip()
			
			self.fitness_feature[self.seq_list.index(seq)] = float(fields[1]) #Selection coefficient
			self.stddev_feature[self.seq_list.index(seq)] = float(fields[2]) #Standard deviation
			self.sem_feature[self.seq_list.index(seq)] = float(fields[3]) #Standard error of the mean
			self.RMSE_feature[self.seq_list.index(seq)] = float(fields[5]) #RMSE
			self.mean_frequency_feature[self.seq_list.index(seq)] = float(fields[6]) #Mean frequency during selection
			self.num_replicates_feature[self.seq_list.index(seq)] = float(fields[7]) #Number of biological replicates
			
			
	def selectTrainingAndTestSets(self):
		
		self.training_set = self.generateEmptyFeature(len(self.seq_list))
		self.testing_set = self.generateEmptyFeature(len(self.seq_list))
		
		for num in range(len(self.fitness_feature)):
			if np.random.rand() > self.training_percent:
				self.training_set[num] = self.fitness_feature[num]
				self.training_size += 1
			else:
				self.testing_set[num] = self.fitness_feature[num]
				self.testing_size += 1.0
				

	

	def setIdentityFeature(self, feature, name, add_not_feature=False):
		self.identity_features.append({'name':name, 'feature':feature})
		#add dictionary of name, feature to Identity feature set
		
		if add_not_feature:
			not_feature = self.generateEmptyFeature(len(self.seq_list), value=1.0) - feature
			self.identity_features.append({'name':"not_"+name, 'feature':not_feature})
		
	
		
	def setValueFeature(self, feature, name):
		self.value_features.append({'name':name, 'feature':feature})
