	def generateCompoundFeatures(self, max_level=-1, remove_redundant_features=True, add_identities_as_features=True, use_value_features=True, use_structural_features=True):
		#Generate all combinations of identity features,
		#Generate a random weight between 0 and 1
		
		if max_level < 0.0:
			max_level = len(self.identity_features) 
		elif max_level > len(self.identity_features):
			max_level = len(self.identity_features)
	
	
		base_identity_features = [] #These will allow for the intercept to be fit on each dimension
		value_and_identity_features = [] #These will allow for the linear fit of the feature to be applied
		structure_value_and_identity_features = []
		
		combinations = []
	
		
		for length in range(max_level):
			for feature_group in itertools.combinations(self.getIdentityFeatures(), length+1):
				group = []	
				for feature in feature_group:
					group.append(feature)
				base_identity_features.append(group)
		
		base_identity_features = self.multiplyFeatures(base_identity_features, generate_weights=False, scale_feature=False)

		
		if remove_redundant_features:
			base_identity_features = self.removeRedundantIdentityFeatures(base_identity_features)
		
		
		if add_identities_as_features:
			combinations.extend(base_identity_features)

			
		for feature in self.value_features:
			for feature_group in base_identity_features:
				new_feature = copy.deepcopy(feature_group)
				new_feature.append(feature)
				value_and_identity_features.append(new_feature) #Copy feature group and add the value feature into the mix
		
		if use_value_features:
			combinations.extend(value_and_identity_features)
		
		
		all_features = copy.deepcopy(base_identity_features)
		all_features.extend(value_and_identity_features)
		for feature in self.structural_features:
			for feature_group in all_features:
				new_feature = copy.deepcopy(feature_group)
				new_feature.append(feature)
				structure_value_and_identity_features.append(new_feature)#Copy feature group and add the value feature into the mix
		
		if use_structural_features:
			combinations.extend(structure_value_and_identity_features)
			
		#Changed for debugging, revert to allow scaling!!!
		#self.compound_features.extend(self.multiplyFeatures(combinations))	
		self.compound_features.extend(self.multiplyFeatures(combinations, scale_feature=False))



	def multiplyFeatures(self, combinations, generate_weights=True, scale_feature=True):
		multiplied_features = []
		for combination in combinations:
			if combination is None:
				continue
			multiplied_feature = self.generateEmptyFeature(len(self.seq_list), value=1.0)
			name = []
			
			for feature in combination:
				multiplied_feature = multiplied_feature * feature['feature']
				name.append(feature['name'])
				
			if scale_feature:	
				multiplied_feature = self.scaleFeature(multiplied_feature)	

			name = '*'.join(name)
			
			if generate_weights:
				weight = np.random.rand()
				multiplied_features.append([{'name':name, 'feature':multiplied_feature, 'weight': weight}])
			elif not generate_weights:
				multiplied_features.append([{'name':name, 'feature':multiplied_feature}])
				
		return multiplied_features
	
	
	def removeRedundantIdentityFeatures(self, feature_list):
		groups = {}
		
		for feature in feature_list:
			size = str(np.sum(feature[0]['feature'])) #Only features with the same number of 1.0 can be identical.
			#This reduces the number of pairwise comparisons that have to be made
			if size == '0.0': #Discard empty identity feature sets
				pass
			else:
				try:
					test = groups[size]
				except KeyError:
					groups[size] = []
				groups[size].append(feature[0])
		
		unique_features = []

		for size in list(groups.keys()):
			unique_for_size =[]
			for feature in groups[size]:
				unique = True
				for num in range(len(unique_for_size)):
					if np.sum(np.abs(feature['feature'] - unique_for_size[num]['feature'])) < 0.000000001: #The two matrices are identical
						#Not yet implemented, keep redundant names
						if len(feature['name'].split('*')) < len(unique_for_size[num]['name'].split('*')):
							unique_for_size[num] = feature #Keep the version with the smallest number of features
							unique = False
						elif len(feature['name'].split('*')) > len(unique_for_size[num]['name'].split('*')):
							unique = False
						elif len(feature['name'].split('*')) == len(unique_for_size[num]['name'].split('*')):
							unique = False
						else:
							pass
					else:
						pass
						
				if unique:
					unique_for_size.append(feature) #add it if it is unique
			
			unique_features.extend(unique_for_size)
			
		final_set = []
		for feature in unique_features:

			final_set.append([feature])
			
		return final_set
				
				
	
	def scaleFeature(self, feature):
	#Get the mean and stddev from the feature
	#subtract the mean and divide by 2*stddev
	#Meant for compound features only
		
		if np.std(feature) == 0.0: #Cannot mean subtract or will get empty vector ->This is an identity array
			if np.abs(np.mean(feature)) > 0.0:
				return (feature/np.abs(np.mean(feature))) #Divide by ||mean|| to get values of magnitude ~1
			else:
				return feature 
		else:		 
			return (feature - np.mean(feature)/(np.std(feature))) #Mean substraction and normalization to standard deviation


	
	def calculateCostFunction(self, training=True):
		#Calculate the cost for the current weight set	
		if training:
			size = self.training_size
			y = self.training_set
			
		elif not training:
			size = self.testing_size
			y = self.testing_set
			
		h = self.generateEmptyFeature(len(self.seq_list), value=0.0)
		theta_sq = 0.0

		for feature in self.compound_features:
			h += (feature[0]['weight'])*(feature[0]['feature'])
			theta_sq += np.square(feature[0]['weight'])
	
		return (1/(2 * size))*(np.nansum(np.square(np.subtract(h,self.training_set))) + self.l2*theta_sq)
	
