	def gradientDescent(self, adjust_alpha=True):
		
		#Keep track of the feature weights over time?
		
		steps = 0
		
		#Get initial (random) state and append_cost to cost array
		self.training_cost = self.calculateCostFunction()
		self.testing_cost = self.calculateCostFunction(training=False)
		self.training_costs.append(self.training_cost)
		self.testing_costs.append(self.testing_cost)
		#update and add to cost lists to evaluate epsilon
		self.updateThetas()
		self.training_cost = self.calculateCostFunction()
		self.testing_cost = self.calculateCostFunction(training=False)
		self.training_costs.append(self.training_cost)
		self.testing_costs.append(self.testing_cost)
		
		
		while np.abs(self.training_costs[-1] - self.training_costs[-2]) > self.epsilon: #Evaluate convergence criterion
			steps += 1
	
			if steps > self.max_rounds:
				break
			
			#Calculate new weights for all parameters
			self.updateThetas()
			
			#Calculate cost
			self.training_cost = self.calculateCostFunction()
			self.testing_cost = self.calculateCostFunction(training=False)
			
			#Append cost to cost array
			self.training_costs.append(self.training_cost)
			self.testing_costs.append(self.testing_cost)
			
			#print(steps, self.training_cost)
			
			#If the cost function increases, decrease the learning rate
			if adjust_alpha and (self.training_costs[-1] - self.training_costs[-2] > 0.0) :
				self.autoResetAlpha()
		
	

		
